import React from "react";
import {Title} from './title';
import styled, { css } from 'styled-components';
import {VantaggiNoleggio} from './vantaggi_noleggio';

const Image_top = styled.img`
    margin-top: 65px;
    margin-bottom: 40px;
    @media only all and (max-width: 500px) {
        width: 100%;
    }
`;
const RedRectangle = styled.div`
    position: absolute;
    right: -210px;
    top: 0px;
    background: #81100B;
    border-radius: 0px 115px 115px 0px;
    width: 1725px;
    height: 227px;  
    z-index: 0;
    @media only all and (max-width: 500px) {
        display: none;
    }
`;
const Text = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    font-style: normal;
    font-weight: bold;
    font-size: 57px;
    line-height: 70px;
    letter-spacing: 0.05em;
    color: #FFFFFF;
    text-align: center;
    position: relative;
    z-index: 1;
    padding-top: 40px;
    @media only all and (max-width: 500px) {
        font-size: 24px;
        line-height: 30px;
        background: #81100B;
        padding: 15px;
    }
`;
const Container_red_rectangle = styled.div`
    position: relative;
    margin-bottom: 88px;
    @media only all and (max-width: 500px) {
        margin-bottom: 30px;
    }
`;
const Container = styled.div`
@media only all and (max-width: 1440px) {
	max-width: 100%!important;
	flex: 0 0 100%!important;
}
`;
function Service() {
    return(
        <>
        <Title/>
        <Container className="col-sm-8 mx-auto text-center"> 
            <Image_top src="./static/images/service_auto.png"></Image_top>
            <Container_red_rectangle>
                <RedRectangle></RedRectangle>
                <Text>PALPONAUTO TI AIUTA SIA NELLA VITA LAVORATIVA CHE NEL PRIVATO</Text>
            </Container_red_rectangle>
            <img src="./static/images/palponservice.png"></img>
        </Container>
        <VantaggiNoleggio/>
        </>
    );
}
export {Service};
